import { PureComponent } from 'react'
import { NavBar } from 'src/components/NavBar'
import PropTypes from 'prop-types'
import { AllProducts } from 'src/components/AllProducts'
import { TechProducts } from 'src/components/TechProducts'
import { ClothesProducts } from 'src/components/ClothesProducts'

import styled from 'styled-components'

const Wrapper = styled.div`
  .content {
    padding: 5px 50px;
    margin: 80px 0 ;
  }
`

export class HomePage extends PureComponent {
  static propTypes = {
    children: PropTypes.any.isRequired,
  }
  render() {
    const {
      props: { children, client },
    } = this

    return (
      <Wrapper>
        <NavBar client={client}>
          <div label="all">
            <div className="content">
              <AllProducts client={client} />
            </div>
          </div>
          <div label="tech">
            <div className="content">
              <TechProducts client={client} />
            </div>
          </div>
          <div label="clothes">
            <div className="content">
              <ClothesProducts client={client} />
            </div>
          </div>
        </NavBar>
        <div className="container">{children}</div>
      </Wrapper>
    )
  }
}

export default HomePage
